import numpy as np  # 数组相关的库
import matplotlib.pyplot as plt  # 绘图库

'''
绘制散点图，来分析映射关系
根据分布集合，来设置映射关系
'''


def scatterDiagram(result, trueResult):
    x = trueResult
    y = result
    plt.figure()
    plt.xlabel('正确结果')
    plt.ylabel('预测结果')
    plt.scatter(x, y)
    plt.show()
    return


def statisticsResult(result, trueResult, num):
    pos = [0]*(num+1)
    neu = [0]*(num+1)
    neg = [0]*(num+1)
    # print(len(trueResult))
    # print(len(result))
    for i in range(len(result)):
        if trueResult[i] == 1:
            # print(int(result[i] * 10))
            pos[int(result[i]*num)] += 1
        elif trueResult[i] == 0:
            # print(int(result[i] * 10))
            neu[int(result[i]*num)] += 1
        else:
            # print(int(result[i]*10))
            neg[int(result[i]*num)] += 1
    return pos, neu, neg


def chooseLeftAndRight(pos, neu, neg, num):
    left = []
    right = []
    sum = []
    for l in range(num):
        for r in range(l, num):
            correct = 0
            for n in range(0, l):
                correct += neg[n]
            for n in range(l, r):
                correct += neu[n]
            for p in range(r, num+1):
                correct += pos[p]
            print(correct)
            sum.append(correct)
            left.append(l*(1/num))
            right.append(r*(1/num))
    return left, right, sum


